local cloneref = cloneref or function(f) return f end
local getgenv = getgenv or function() return _G end
local environment = setmetatable({}, {
    __index = function(_, index)
        local v = index:gsub("_%l", string.upper):gsub("_", ""):gsub("^%l", string.upper)
        return cloneref(game:GetService(v))
    end
})

if not isfolder("viteck") then makefolder("viteck") end
if not isfolder("viteck/lua") then makefolder("viteck/lua") end

local viteck = {
    cache = {},
    options = { Graph_35 = {}, Smallest_Pixel = {}, Templeos = {} }
}

function viteck.cache:Register_Font(Name, Weight, Style, Asset)
    local asset_path = "viteck/" .. Asset.Id
    local font_path = "viteck/" .. Name .. ".font"
    if not isfile(asset_path) then writefile(asset_path, Asset.Font) end
    writefile(font_path, environment.HttpService:JSONEncode({ name = Name, faces = {{ name = "Regular", weight = Weight, style = Style, assetId = getcustomasset(asset_path) }} }))
    return getcustomasset(font_path)
end

viteck.options.Graph_35 = viteck.cache:Register_Font( "Graph_35", 200, "normal", { Id = "Graph_35.ttf", Font = crypt.base64.decode("")})
viteck.options.Smallest_Pixel = viteck.cache:Register_Font( "Smallest_Pixel", 200, "normal", { Id = "Smallest_Pixel.ttf", Font = crypt.base64.decode("")})
viteck.options.Templeos = viteck.cache:Register_Font( "Templeos", 200, "normal", { Id = "Templeos.ttf", Font = crypt.base64.decode("")})

--init
getgenv().fonts = viteck
